import Link from 'next/link';
import MyLogo from './MyLogo';

const linkStyle = {
  marginRight: 200,
};
const Header = () => (
  <div>
    <MyLogo/>
    <Link href="/">
      <a className="home">Home</a>
    </Link>
    <Link href="/about">
      <a className="about" >About</a>
    </Link> 
    <style jsx>{`
    .home {
      color: white;
      text-decoration: none;
      padding: 10px 20px;
      background-color: blue;
    }
    .about {
      color: white;
      text-decoration: none;
      padding: 10px 20px;
      background-color: blue;
    }
    `}
    </style>
  </div>
);

export default Header;
